	public static int lengthOfLongestSubstring(String s) {
		int len = s.length();
		for (int i = len; i > 0; i--) {
			for (int j = 0; j < s.length(); j++) {
				if (j + i <= s.length()) {
					if (areDuplicatesExist(s.substring(j, j + i))) {
						return i;
					}
				} else {
					break;
				}
			}
		}
		return 1;
	}

	private static boolean areDuplicatesExist(String s) {
		Set<Character> chars = new HashSet<>();
		int len = chars.size();
		for (int i = 0; i < s.length(); i++) {
			chars.add(s.charAt(i));
			if (len < chars.size()) {
				len = chars.size();
				continue;
			}
			return false;
		}
		return true;
	}
